Kansassss Cityyyyyy , The “Fly Over City” Nah… 

What a time to be alive 🛫 it was pretty cool to be a part of history! 

@rondoo49 & I - among others planned and took @southwestair flight 3369 to CHICAGO, the last flight out of the old KCIA Terminal & flew back 6 hours later to be the first southwest flight 1980 into the brand new awaited terminal, which is nothing less than amazing and what KC was in need of as @quinton_lucas said “We have always had a dynamic city with a great workforce, culture, restaurants and beyond.” “Now, we have a state-of-the-art airport terminal to match.”

None of us knew or expected what the teams had planned in the terminals on departure and arrival!?
We had balloon arches , picture opportunities, champagne, mimosas and not to mention We were welcomed home with a water solute and of course teams of media from every channel. 
This was really something cool to see in person , let alone be immersed in it first hand. 

I was happy to be a part of this and look forward to watching this city I love grow even more. 

My Hats off to everyone involved in making this masterpiece come to life 

